export default function TaskList(props){
    return <table>
        <tbody>
        {props.data.map(t =>
            <TaskItem taskItem={t}
                    key={t.id}
                    isCompleted={props.TaskItem.isC(t.id)}
                    onTaskSelected={props.onTaskSelected}
                    onHandleChange = {props.onHandleChange}
            />
        )}
        </tbody>
    </table>
}
